import React from "react";
import { Col } from "react-bootstrap";

function CardMovie({ movie }) {
  console.log(movie);
  return (
    <Col xs="6" sm="6" md="4" lg="6" className="my-1">
      <div className="card">
        <img src="habib.jpeg" className="card_image" alt="habib" />
        <div className="card_overlay">
          <div className="overlay_text text-center w-100 p-2">
            <p> {movie.original_title} اسم الفيلم</p>
            <p>تاريخ الاصدار : {movie.release_date}</p>
            <p>عدد المقيمين: {movie.vote_count}</p>
            <p>التقييم: {movie.vote_average}</p>
          </div>
        </div>
      </div>
    </Col>
  );
}

export default CardMovie;
